INSERT INTO `jianlimoban` VALUES (21, '2021-03-29 21:11:10', '软件开发模板', '开发', '<p><span style=\"color: rgb(84, 84, 84);\">稻小壳</span></p><p><br></p><p><span style=\"color: rgb(84, 84, 84);\">求职岗位：移动开发</span></p><p>&nbsp;</p><p><strong style=\"color: rgb(85, 85, 85);\">性别：</strong><span style=\"color: rgb(85, 85, 85);\">男</span></p><p><strong style=\"color: rgb(85, 85, 85);\">年龄：</strong><span style=\"color: rgb(85, 85, 85);\">22</span></p><p><strong style=\"color: rgb(85, 85, 85);\">电话：</strong><span style=\"color: rgb(85, 85, 85);\">13800000001</span></p><p><strong style=\"color: rgb(85, 85, 85);\">邮箱：</strong><span style=\"color: rgb(85, 85, 85);\">kingsoft@docer.cn</span></p><p>&nbsp;<img src=\"data:image/png;base64,\"></p><p>&nbsp;</p><p><strong style=\"color: rgb(66, 103, 158);\">求职意向</strong></p><p><span style=\"color: rgb(85, 85, 85);\">意向岗位：移动开发</span></p><p><span style=\"color: rgb(85, 85, 85);\">意向城市：北京</span></p><p><span style=\"color: rgb(85, 85, 85);\">期望薪资：面议</span></p><p><span style=\"color: rgb(85, 85, 85);\">求职类型：社招</span></p><p>&nbsp;</p><p><strong style=\"color: rgb(66, 103, 158);\">教育经历</strong></p><p><img src=\"//:0\" height=\"1\" width=\"549\"></p><p><strong>开始时间-结束时间	学校名称</strong></p><p><span style=\"color: rgb(82, 82, 82);\">专业 | 学历</span></p><p>&nbsp;</p><p><span style=\"color: rgb(102, 102, 102);\">大学之前的教育经历建议不写，尽量写与求职行业或者求职岗位相关的课程，有交流交换的经验可以在教育经历中展示。工作年限较多或成绩自认不够优异，则可以直接将教育背景清晰罗列后，重点丰富其他模块。成绩优异的话建议写上GPA及排名等信息，尽量简洁。</span></p><p>&nbsp;</p><p><strong style=\"color: rgb(66, 103, 158);\">工作经历</strong></p><p><img src=\"//:0\" height=\"1\" width=\"549\"></p><p>&nbsp;</p><p>&nbsp;</p><p><strong>2017.5-2018.4	金山办公软件有限公司&nbsp;</strong></p><p><span style=\"color: rgb(82, 82, 82);\">移动开发 | 互联网通信</span></p><p>&nbsp;</p><p><span style=\"color: rgb(102, 102, 102);\">1.负责Android团队内部建设和管理； 2.负责团队技术培训，带领团队参加“挑战杯”、“发现杯”比赛； 3.期间开发金点原子、江门社保局智能监控系统二期工程、高校Plus等项目。</span></p><p>&nbsp;</p><p><strong style=\"color: rgb(66, 103, 158);\">项目经历</strong></p><p><img src=\"//:0\" height=\"1\" width=\"549\"></p><p>&nbsp;</p><p>&nbsp;</p><p><strong>2018.4-2019.4	金山办公软件有限公司&nbsp;</strong></p><p><span style=\"color: rgb(82, 82, 82);\">移动开发</span></p><p>&nbsp;</p><p><span style=\"color: rgb(102, 102, 102);\">技术类 项目描述：根据《建设项目经济评价方法与参数（第三版）》，使用Excel软件，结合新能源行业特点，建立新能源项目经济评价模型。该模型不但具备正向计算收益率、反向计算收购价格的功能，同时提供多组输出收益率和收购价格输出结果；而且具备财务预测的功能，可服务于财务规划。 项目职责：1.以excel软件为平台搭建经济评价模型框架，设计报表格式，主要报表包括还本付息表、损益表、资产负债表、资本金现金流量表、投资方现金流量表等。 2.还本付息表可选择使用等额本金与等额本息两种还款方式。模型可自动识别资金余缺情况，在资金短缺时自动计算短期借款与利息支出。 3.充分考虑行业增值税即征即退50%、所得税三免三减半税收政策，并将项目建设期进项税结转抵扣、经营亏损五年弥补等规定全部嵌入模型。 4.考虑新能源行业政策，包括限电、竞价上网、补贴拖欠等，进一步完善模型结构，实现全自动计算、零人工调整。</span></p><p>&nbsp;</p><p><strong style=\"color: rgb(66, 103, 158);\">自我评价</strong></p><p><img src=\"//:0\" height=\"1\" width=\"549\"></p><p>&nbsp;</p><p>&nbsp;</p><p><span style=\"color: rgb(102, 102, 102);\">1. 两年多Android实际开发经验，参与多个项目开发，技术有了一个质的提升。知识网络逐渐延伸，不单限于SDK对接、正向的安卓开发方向，安卓的逆向技术使我对安卓开发的认识上升了一个台阶。 2. 熟悉项目开发流程，掌握Android常用的API、数据存储、网络通信、XML/JSON解析、消息推送以及UI布局等，掌握多种第三方平台接入，具备独立开发能力。 3. 经常逛github技术博客 了解最新的安卓攻防技术。 4. 熟悉掌握eclipse 、android studio、apktool 等工具。 5. 对技术充满好奇跟热情。</span></p>', 'http://localhost:8080/springbootz9481/upload/jianlimoban_zhaopian1.jpg', 3, 1, '2024-01-07 15:32:37', 24);
